import React from 'react';
import css from './Users.module.css';

const Users = (props) => {
    return (
        <div className={css.container}>
            <ul>
                {
                    props.users.map(u => {
                        return (
                            <li key={u.id}>
                                <div>
                                <img alt='avatar'></img>
                                <button>{u.followed ? 'Unfollow' : 'Follow'}</button>
                                </div>
                                <div>{u.name}</div>
                                <div>{u.location.city + '' + u.location.country}</div>
                                <div>{u.status}</div>
                            </li>
                        )
                    })
                }
            </ul>
        </div>
    )
}

export default Users;
